import { Routes, Switch, Route } from 'react-router-dom';
import Landing from './Landing';

function Router(){
    return(
        <Routes>

                <Route path='/' component={Landing}></Route>
                <Route path='/forum' component={Landing}></Route>

        </Routes>
    );
}

export default Router;
